import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { Error404Component } from './error404/error404.component';



@NgModule({
  declarations: [
    Error404Component
  ],
  imports: [
    CommonModule
  ]
})
export class NotfoundModule { }
